import styled from "@emotion/styled";
import { Box } from "@mui/system";
import React from "react";
import { Link } from "react-router-dom";

const ImageBoxContainer = styled(Box) ({
    display:'flex' , 
    flexDirection:'column' , 
    justifyContent:'center' , 
    width:"100%",
})

const ImageBox = styled(Box)({
    margin:'0 auto'
})

const GoLink = styled(Link)({
    textDecoration:'none' ,
    color:'inherit' ,
    display:'flex' , 
    justifyContent:'center'
})

const GoImage = styled(Box)({

})

function Designer(){

    return(
        <ImageBoxContainer>
            <ImageBox component="img" src="img/designer.png" width="90%" ></ImageBox>
            <GoLink to="../upload" >
                <GoImage component="img" src="img/go.png" sx={{width:"130px" ,position:"relative",left:"48%", top:-220}}>
                </GoImage>
            </GoLink>
        </ImageBoxContainer>
    );
}

export default Designer;
